import styles from "./styles.module.scss";

interface StatsCardProps {
  title: String;
  value: Number;
}

export const StatsCard: React.FC = (props) => {
  return (
    <article className={styles.stats_card}>
      <h2>{props.title}</h2>
      <span>{props.value}</span>
    </article>
  );
};
